oxy_webhelp_navlinks = {"fram_workspace_overview_c-d4802e1366":{"topics":[{"title":"How do I create a workspace page?","shortdesc":"<p class=\"shortdesc\">You can create a workspace page to organize your links to applications. A workspace can contain up to 32 pages.<\/p>","href":"fram_create_workspace_t.html","attributes":{"data-id":"fram_create_workspace_t"},"menu":{"hasChildren":false},"tocID":"fram_create_workspace_t-d4802e1388","topics":[]},{"title":"How do I name a workspace page?","shortdesc":"<p class=\"shortdesc\">You may want to name workspace pages to help organize your work. For example, if you work with three types of applications -- applications containing human resources information, applications related to sales issues, and applications related to international issues -- you might enter the names HR, Sales, and International on different workspace tabs and move applications of each type to the corresponding workspace pages.<\/p>","href":"fram_name_workspace_page_t.html","attributes":{"data-id":"fram_name_workspace_page_t"},"menu":{"hasChildren":false},"tocID":"fram_name_workspace_page_t-d4802e1403","topics":[]},{"title":"How do I change my workspace background?","shortdesc":"<p class=\"shortdesc\">You can use your own background image for the workspace or you can remove an image an use the workspace tab color as the background.<\/p>","href":"fram_change_workspace_background.html","attributes":{"data-id":"task_nls_rxd_w2b"},"menu":{"hasChildren":false},"tocID":"task_nls_rxd_w2b-d4802e1418","topics":[]},{"title":"How do I delete a workspace page?","shortdesc":"<p class=\"shortdesc\">You can easily delete workspace.<\/p>","href":"fram_delete_workspace_page_t.html","attributes":{"data-id":"fram_delete_workspace_page_t"},"menu":{"hasChildren":false},"tocID":"fram_delete_workspace_page_t-d4802e1431","topics":[]},{"title":"How do I switch to a different workspace page?","shortdesc":"<p class=\"shortdesc\">Click the page's workspace tab. To use the keyboard to switch to a different page, press <span class=\"ph uicontrol\">CTRL<\/span> and the left or right arrow.<\/p>","href":"fram_switch_workspace_page_t.html","attributes":{"data-id":"fram_switch_workspace_page_t"},"menu":{"hasChildren":false},"tocID":"fram_switch_workspace_page_t-d4802e1446","topics":[]},{"title":"How do I change the color of a workspace page tab?","shortdesc":"<p class=\"shortdesc\">You can change the color of a workspace tab.<\/p>","href":"fram_change_workspace_color_t.html","attributes":{"data-id":"fram_change_workspace_color_t"},"menu":{"hasChildren":false},"tocID":"fram_change_workspace_color_t-d4802e1464","topics":[]},{"title":"To compact your workspace file","shortdesc":"<p class=\"shortdesc\">You can save disk space by compacting a file called desktop6.ndk, which is part of the workspace files. Compacting recovers unused disk space by removing references to applications you no longer have on your workspace. <\/p>","href":"fram_compact_workspace_file_t.html","attributes":{"data-id":"fram_compact_workspace_file_t"},"menu":{"hasChildren":false},"tocID":"fram_compact_workspace_file_t-d4802e1479","topics":[]},{"title":"How do I change text color in my workspace?","shortdesc":"<p class=\"shortdesc\"\/>","href":"change_workspace_text_color.html","attributes":{"data-id":"change_workspace_text_color"},"menu":{"hasChildren":false},"tocID":"change_workspace_text_color-d4802e1494","topics":[]}]}};